import {Form,Main,Input,Button,Col,Label,TextArea} from './style'
const DiscussForm=()=>{
    return( 
         <Main><Form><Col>
       <Label for="html">HTML</Label><Input/>
         <Label for="html">HTML</Label>
        <Input/></Col><Col><Label for="html">HTML</Label><Input/>
        <Label for="html">HTML</Label><Input/></Col>
        <Col><Label for="html">HTML</Label><TextArea/></Col>
        </Form>
        <Button></Button></Main>
        )
}
export default DiscussForm;
